tables.table_schema:
CREATE TABLE AthleteProgressReport (
    athlete_id INT,
    date DATE,
    training_volume INT,
    strength_gains INT
);

CREATE TABLE Athletes (
  athlete_id INT PRIMARY KEY,
  athlete_name VARCHAR(50),
  athlete_age INT,
  athlete_gender VARCHAR(10)
);

CREATE TABLE athlete_progress (
    athlete_id INT PRIMARY KEY,
    date DATE,
    progress_metric VARCHAR(50)
);

CREATE TABLE training_volume (
    athlete_id INT PRIMARY KEY,
    date DATE,
    volume_metric INT
);

CREATE TABLE strength_gains (
    athlete_id INT PRIMARY KEY,
    date DATE,
    strength_metric DECIMAL(10,2)
);
